import { Box, Center, Grid, Text } from "@mantine/core";

import React from "react";

const Layout3Object = {
  Type: Box,
  props: {
    bg: "lime.5",
    style: { borderRadius: "10px 10px 0 0", cursor: "pointer" },
  },
  children: [
    {
      Type: Center,
      children: {
        Type: Text,
        children: "Test",
      },
    },
  ],
};

const createMantineComponent = (config) => {
  const { type, props, children } = config;
  return React.createElement(type, props, children && createMantineComponent(children));
};

const Layout3 = () => {
  const items = ["Item 1", "Item 2", "Item 3"];
  const customBox = createMantineComponent(Layout3Object);

  return (
    <Box bg="gray.4" h={200} style={{ borderRadius: "10px" }}>
      {customBox} {/* Render the customBox directly */}
      <Grid ml="xs" mr="xs">
        {items.map((item) => (
          <Grid.Col span={4} key={item}>
            <Box
              bg="blue.1"
              h={60}
              style={{ border: "1px solid #000000", cursor: "pointer" }}
            >
              <Center>{item}</Center>
            </Box>
          </Grid.Col>
        ))}
      </Grid>
    </Box>
  );
};

export default Layout3;
